import React, { useState } from "react";

const Dog = (props) => {
  const genderDogs = props.dogs.gender.map((gender, index) => {
    let genderColor = "";
    if (gender.includes("Male")) {
      genderColor = "blue";
    } else {
      genderColor = "pink";
    }
  });
  return (
    <li key={index} genderDogs="gender" className={genderColor}>
      {gender}
    </li>
  );
  return (
    <article className="article">
      <img
        className="article__image"
        src={props.dogs.url}
        alt={props.dogs.name}
      />
      <div className="nameGender">
        <p className="nameGender__name">{props.dogs.name}</p>
        <div className="nameGender__gender">
          {props.dogs.gender === "Female" ? (
            <i class="nameGender__gender--female fas fa-venus"></i>
          ) : (
            <i class="nameGender__gender--male fas fa-mars"></i>
          )}
        </div>
      </div>
      <p className="article__breed">{props.dogs.breed}</p>
      <button>Ver perfil</button>
    </article>
  );
};

export default Dog;
